import React from 'react'
export const BeerList = ({image,name,tagline,contributed_by})=>{
  return(
    <li>
      <img src={image} alt={name}/>
      <ul>
        <li><h2>{name}</h2></li>
        <li>{tagline}</li>
        <li>contributed by: {contributed_by}</li>
      </ul>
    </li>
  )
}
